import React from 'react';
import personalInfo from '../personal/info.json';

const Projects = () => {
  const { projects } = personalInfo;

  return (
    <div>
      {projects.slice(0, 1).map((project, index) => (
        <div key={index}>
          <h3>{project.name}</h3>
          <p>{project.year}</p>
          <p>{project.description}</p>
        </div>
      ))}
    </div>
  );
};

export default Projects;
